        let type = data.data.properties.type

        if (type !== 'upload' && inComingNodes.length === 0) {
            _this.$message.error('请配置数据源')
            return
        }

        if (inComingNodes.length > 0) {
            for (let i = 0; i < inComingNodes.length; i++) {
                if (!(inComingNodes[i].id in _this.xlsxData)) {
                    _this.$message.error('前节点数据为空')
                    return
                }
            }
        }

        _this.config.title = data.data.text.value
        _this.draw[data.data.properties.type] = true
        _this.nowOption = {
            id: data.data.id,
            preview: false
        }

        _this.typeFunction[data.data.properties.type](_this, data, inComingNodes)

